کوتاه‌ترین مسافتی که می‌توان طی کرد اگر از هر نقطه‌ای، $A$، $B$، $C$، یا $D$، شروع کنید و به سه نقطه دیگر یک بار سر بزنید، چقدر است؟

[asy]
pair A,B,C, D;
A = (-3,3); B = (3,0); C = (0, -4); D = (0,0);
